using System;

namespace MCDzienny.StoreSystem
{
    public class Color : Item
    {
        public override string Name
        {
            get
            {
                return "Color";
            }
        }

        public override int ListPosition
        {
            get
            {
                return 8;
            }
        }

        public override int GetAmount(Player p)
        {
            return 1;
        }

        public override int GetPrice(Player p)
        {
            return 280;
        }

        public override bool GetIsListed(Player p)
        {
            return true;
        }

        public override string GetDescription(Player p)
        {
            return " - use /color [color] to set your name color,";
        }

        public override string GetHelp(Player p)
        {
            return "In order to use this item use /color command.";
        }

        public override bool OnBuying(Player p)
        {
            if (p.boughtColor)
            {
                Player.SendMessage(p, "You have already bought this item. In order to use it write: /color");
                return false;
            }

            return true;
        }

        public override void OnBought(Player p)
        {
            p.boughtColor = true;
            Player.SendMessage(p, "In order to change the color of your name use the command: /color");
        }
    }

	public class Disinfect : Item
    {
        public override string Name
        {
            get
            {
                return "Disinfect";
            }
        }

        public override int ListPosition
        {
            get
            {
                return 1;
            }
        }

        public override int GetAmount(Player p)
        {
            return 1;
        }

        public override int GetPrice(Player p)
        {
            return 100;
        }

        public override bool GetIsListed(Player p)
        {
            return true;
        }

        public override string GetDescription(Player p)
        {
            return " - turns you back into a human,";
        }

        public override string GetHelp(Player p)
        {
            return "If you buy this item you will change back to a human.";
        }

        public override bool OnBuying(Player p)
        {
            if (!p.isZombie)
            {
                Player.SendMessage(p, "You are still a human. You don't need the disinfection... yet.");
                return false;
            }
			if (InfectionSystem.InfectionSystem.infected.Count == 1)
			{
			    Player.SendMessage(p, "You can't get disinfected if you are the only zombie.");
				return false;
			}
			if (InfectionSystem.InfectionUtils.EndTime.Subtract(DateTime.Now).TotalMinutes < 3)
			{
			    Player.SendMessage(p, "It's too late to get disinfected.");
				return false;
			}

            return true;
        }

		public override void OnBought(Player p)
        {
            InfectionSystem.InfectionSystem.notInfected.Add(p);
			InfectionSystem.InfectionSystem.infected.Remove(p);
			InfectionSystem.InfectionSystem.RemoveZombieDataAndSkin(p);
			Player.GlobalMessageLevel(InfectionSystem.InfectionSystem.currentInfectionLevel, p.PublicName + "%a has been disinfected!");
			InfectionSystem.InfectionSystem.DisplayHumansLeft();
        }
	}

